import React from 'react'

const Home = () => {
  return (
    <div className="container-fluid px-5 my-4">
    <img 
      src=".jpg" 
      alt="Hero Banner" 
      className="img-fluid"
      style={{
        width: "100%",   // Stretches within container but respects padding
        height: "450px", // Increased height for more visual impact
        objectFit: "cover", // Prevents distortion, keeps it looking sharp
        borderRadius: "12px", // Soft rounded edges for a sleek touch
        boxShadow: "0px 6px 15px rgba(0, 0, 0, 0.2)" // Subtle shadow for depth
      }}
    />
  </div>
  
  
  )
}

export default Home
